import React from 'react';
import logo from './logo.svg';
import './css/App.css';
import './css/main.css';
import './css/toppage.css';
import './css/cssset.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
            <table summary="メール送信">
              <tr>
                <th className="lib1"><span class="req">必須</span>会社名・屋号</th>
                <td className="lib2"><input name="company" type="text" className="short" /></td>
              </tr>
            </table>
            <p className="ali_center">
              <input type="submit" class="form_btn" value="確認画面へ ＞" />
            </p>
      </header>
    </div>
  );
}

export default App;
